script: |
  super -f text -I q10616.spq | sort > q10616.out

inputs:
  - name: q10616.spq
    data: |
      SELECT DISTINCT - col1 * + + 4 AS col2 FROM tab0 (FORMAT parquet) WHERE col2 + + col1 * + CAST ( NULL AS INTEGER ) <= - + col0 + col1 * + + CAST ( - - col1 AS INTEGER );
  - name: tab0

outputs:
  - name: q10616.out
    data: |
